"""
1. Отсортируйте по убыванию методом "пузырька" одномерный целочисленный массив,
заданный случайными числами на промежутке [-100; 100). Выведите на экран
исходный и отсортированный массивы.

Сортировка должна быть реализована в
виде функции.

Обязательно доработайте алгоритм (сделайте его умнее)!

Идея доработки: если за проход по списку не совершается ни одной сортировки,
то завершение
Обязательно сделайте замеры времени обеих реализаций
и обосновать дала ли оптимизация эффективность

Подсказка: обратите внимание, сортируем не по возрастанию, как в примере,
а по убыванию.

Сделайте выводы!!!
Опишите в чем была ваша доработка и помогла ли вам доработка??
"""

import random
import timeit
import cProfile
import time
from memory_profiler import profile, memory_usage
import numpy


def time_memory_decorator(tmd):
    def wrapper(*args, **kwargs):
        time_start = time.time()
        m1 = memory_usage()
        ans = tmd(*args, **kwargs)
        print(f'Время выполнения: {time.time() - time_start}')
        m2 = memory_usage()
        print(f'Расход памяти: {m2[0] - m1[0]}')
        return ans

    return wrapper


@time_memory_decorator
def bubble_sort(orig_list):
    """Стандартнный подход"""
    n = 1
    while n < len(orig_list):
        for i in range(len(orig_list) - n):
            if orig_list[i] < orig_list[i + 1]:
                orig_list[i], orig_list[i + 1] = orig_list[i + 1], orig_list[i]
        n += 1
    return orig_list


@time_memory_decorator
def bubble_sort_2(orig_list):
    """Доработанный подход. Если за проход по списку
     не совершается ни одной сортировки, то завершение"""
    n = 1
    k = 0
    while n < len(orig_list):
        for i in range(len(orig_list) - n):
            if orig_list[i] < orig_list[i + 1]:
                orig_list[i], orig_list[i + 1] = orig_list[i + 1], orig_list[i]
                k = 1
        if k == 0:
            break
        n += 1
    return orig_list


def start_sort(orig_list):
    orig_list2 = orig_list
    print(bubble_sort(orig_list))
    print(bubble_sort_2(orig_list2))
    print()


@profile
def start_sort_profiled(orig_list):
    orig_list2 = orig_list
    print(bubble_sort(orig_list))
    print(bubble_sort_2(orig_list2))
    print()


@time_memory_decorator
def combsort(alist):
    alen = len(alist)
    gap = (alen * 10 // 13) if alen > 1 else 0
    while gap:
        if 8 < gap < 11:    ## variant "comb-11"
            gap = 11
        swapped = False
        for i in range(alen - gap):
            if alist[i + gap] > alist[i]:
                alist[i], alist[i + gap] = alist[i + gap], alist[i]
                swapped = True
        gap = (gap * 10 // 13) or swapped
    print(alist)


@time_memory_decorator
def standart_sort(temp_list):
    temp_list = sorted(temp_list)
    print(temp_list)


input_list = [random.randint(-100, 100) for i in range(5000)]

print(input_list)

start_sort(input_list)
# start_sort_profiled(input_list)
combsort(input_list)
standart_sort(input_list)

