# постепенно уменьшается, пока разница не составит 1, после чего завершается обычным пузырьком.
#
# Теоретически, эта разновидность должна была обеспечить максимальную скорость работы, и преимущество действительно
# есть, если сравнивать с классическим пузырьком. Однако пузырёк с отсечкой значительно превосходит не только свой
# "классический" аналог, но и расчёску, выводя его эффективность на первое место среди протестированных методов.
#
# Использование встроенного профилировщика в данном случае не только не улучшило результаты, но и очень значительно
# затормозило процесс, что говорит о целесообразности не использования его в подобных сценариях.
# Встроенная сортировка показала результат немногим хуже, нежели пузырёк с остановкой.
#
# Таким образом, в задаче сортировки массива в 5000 эллементов самая эффективная сортировка - пузырь с остановкой.


